B.Sk=new A.cG("rose-bush","Rose Bush (Hybrid Tea)","PKR 1,200","Fragrant, classic blooms with long stems. Perfect for borders and cutting.","Bring home the show-stopping elegance of our Hybrid Tea Rose\u2014Pakistan\u2019s favorite cut-flower rose for a reason. Each long, straight stem carries a single, high-centered bloom that opens into classic, velvety petals perfect for vases, wedding d\xe9cor, and statement borders. Planted in full sun (6\u20138 hours) and well-drained, compost-rich soil, Hybrid Teas reward you with repeat flushes from spring through late autumn; a light afternoon shade in extreme heat keeps colors intense and petals pristine. They\u2019re surprisingly manageable: water deeply 1\u20132 times a week once established, mulch to lock in moisture, feed monthly during the growing season, and deadhead spent blooms to trigger the next wave. A simple late-winter prune (Jan\u2013Feb) to 3\u20135 strong canes keeps plants vigorous and floriferous, while good airflow plus occasional neem/soap sprays help deter common pests and leaf spot. Whether you\u2019re styling a terrace in Karachi, a courtyard in Lahore, or a garden bed in Islamabad, this rose delivers luxury on demand\u2014sumptuous fragrance, florist-grade stems, and nonstop color that lifts every space. Add one as a focal point or group several for a designer hedge, then clip fresh blooms straight to your table. Ready to upgrade your garden and your home d\xe9cor? Order your Hybrid Tea Rose today and enjoy bouquet-worthy flowers just steps from your door.","assets/plants/rose1.jpg",B.Md)
