B.Sp=new A.cG("areca-palm","Areca Palm","PKR 6,500","Lush, feathery fronds. Brings tropical vibes indoors or on patios.","Elevate your space instantly with the Areca Palm (Dypsis lutescens)\u2014the lush, feathery \u201cgolden cane\u201d that delivers resort vibes to apartments, offices, and patios across Pakistan. A graceful clumping palm with multiple bamboo-like canes and elegant arching fronds, Areca thrives in bright, indirect light indoors (near a window with filtered sun) and in bright shade outdoors; protect it from harsh midday rays in Karachi/Lahore summers to keep leaf tips pristine. Give it a fast-draining mix (potting soil + perlite/coarse sand), water when the top 2\u20133 cm feel dry, and never leave the roots standing in saucers; consistent, moderate moisture is key. From spring through monsoon, feed monthly with a balanced, palm-safe fertilizer, then reduce in winter; repot every 2\u20133 years into a 10\u201314\u2033 pot as clumps expand. Brown tips usually signal low humidity or salts\u2014mist occasionally, wipe fronds to shine, and flush the soil every few months. Naturally non-toxic to cats and dogs and widely praised for air-freshening foliage, Areca Palms grow quickly to 5\u20138 ft indoors (taller in courtyards), creating soft privacy screens for balconies and a designer focal point for living rooms, lobbies, and caf\xe9s. Pest-wise they\u2019re easy: check for spider mites/mealybugs and treat early with neem. Want a polished, tropical look with minimal fuss and maximum impact? Choose the Areca Palm\u2014our most popular indoor palm\u2014and enjoy a breezy, boutique-hotel feel every day.","assets/plants/areca1.jpg",B.LU)
