B.St=new A.cG("ficus-benjamina","Ficus Benjamina (Weeping Fig)","PKR 5,000","Elegant, glossy foliage. A timeless indoor statement tree.","Bring timeless elegance to your home or office with Ficus benjamina (Weeping Fig)\u2014the designer-favorite statement tree that instantly adds height, texture, and a calm, upscale vibe. Its slender, braided-ready trunk and dense, glossy canopy look stunning in living rooms, foyers, caf\xe9s, and reception areas across Pakistan. Give it bright, indirect light (a few hours of filtered sun near an east or bright south window) and a fast-draining mix; water when the top 2\u20133 cm of soil are dry, then let excess drain\u2014consistent, not soggy. Feed monthly in spring through monsoon with a balanced fertilizer, pause in winter, and rotate the pot periodically for even shape. Expect some leaf drop after moving or seasonal changes\u2014totally normal; reduce drafts, avoid overwatering, and it rebounds quickly. Prune lightly in late winter to maintain a crisp silhouette or to encourage a lush, umbrella form; wipe leaves to keep that luxurious sheen. Watch for scale or mealybugs and treat early with neem or insecticidal soap. Mature indoor plants reach 5\u20138 ft, creating natural privacy and a premium \u201chotel-lobby\u201d finish without the maintenance headaches of more delicate species. (Note: sap can irritate sensitive skin; keep out of reach of curious pets.) Want a sophisticated, evergreen focal point that reads \u201ctasteful\u201d from every angle? Choose Weeping Fig and elevate your space\u2014beautifully and effortlessly.","assets/plants/ficus1.jpg",B.KY)
