B.SB=new A.cG("lavender","Lavender (English)","PKR 900","Aromatic purple spikes; pollinator magnet. Loves sun, hates wet feet.","Turn any sunny corner into a spa-scented showpiece with English Lavender (Lavandula angustifolia)\u2014the low-maintenance, high-impact classic that delivers silvery foliage, violet flower spikes, and a soothing fragrance all season. Perfect for borders, pathways, patios, and rooftops, it forms neat mounds (about 30\u201360 cm tall and 45\u201360 cm wide) that look designer-clean even when not in bloom. Give it full sun and excellent drainage (gritty/sandy mix; raised beds or pots are ideal), water deeply but infrequently once established, and avoid \u201cwet feet.\u201d In Pakistan\u2019s warmer zones, choose the sunniest, breeziest spot for good airflow; in cooler areas it thrives with ease and even tolerates light frost. Trim lightly after the first flush to keep a compact shape and encourage repeat flowering, then give a harder prune at the end of winter to refresh growth. Lavender\u2019s nectar-rich blooms attract bees and butterflies, while its natural oils help deter common pests\u2014so your garden stays lively and low-fuss. Cut stems for long-lasting bouquets, dry them for sachets and wreaths, or infuse teas and bakes with culinary varieties. Pair it with roses, ornamental grasses, and stone edging for that timeless Mediterranean look. Want effortless elegance, fragrance, and pollinator power in one plant? Choose English Lavender and upgrade your space\u2014beautifully, sustainably, and year after year.","assets/plants/lav1.jpg",B.MH)
