B.Sf=new A.cG("snake-plant","Snake Plant (Sansevieria)","PKR 1,800","Ultra-tough, architectural leaves. Thrives on neglect.","Built for busy homes and modern offices, the Snake Plant (Sansevieria)\u2014also known as Dracaena trifasciata\u2014delivers designer looks with near-indestructible toughness, making it the ultimate \u201cset-and-forget\u201d statement plant you\u2019ll actually keep alive. Its upright, sculptural leaves (usually 30\u201390 cm tall, taller in floor pots) bring clean architectural lines to hallways, lounges, bedrooms, and reception areas, while variegated patterns (from classic \u2018Laurentii\u2019 with golden edges to cool-toned \u2018Moonshine\u2019 and deep green \u2018Zeylanica\u2019) complement every interior. It tolerates low to bright, indirect light (even fluorescent offices), thrives on infrequent watering (let soil dry completely between drinks\u2014every 2\u20134 weeks depending on season), and prefers a fast-draining mix (cactus/succulent blend with added perlite). Warm rooms are ideal (18\u201330 \xb0C); it shrugs off dry air and occasional neglect, and you\u2019ll rarely see pests. Styling is effortless: use tall cylinders for a minimalist look, cluster three sizes for a layered vignette, or line a corridor with matching planters for a boutique-hotel vibe. Maintenance is minimal\u2014wipe leaves monthly to restore their shine, rotate the pot for even growth, and feed lightly in spring/summer. Want more plants for free? Divide clumps when repotting or propagate leaf cuttings. With a reputation for freshening up the feel of indoor air and a proven track record as the hardiest houseplant on the market, the Snake Plant is an easy upsell for landlords, caf\xe9s, studios, and busy families alike\u2014low water, low drama, maximum style.","assets/plants/snake1.jpg",B.NS)
