B.Sv=new A.cG("bougainvillea","Bougainvillea","PKR 3,200","Explosive color; thrives in heat and full sun. Great for trellises.",'Turn any wall, gate, or rooftop into a tropical postcard with Bougainvillea\u2014the sun-loving color machine that thrives in Pakistan\u2019s heat and rewards you with cascades of magenta, fuchsia, orange, red, or snow-white bracts for months on end. Give it 6\u20138 hours of direct sun, a sturdy support (trellis, pergola, boundary wall, balcony railing), and very free-draining soil, and it will repay you with explosive bloom cycles and minimal upkeep; water deeply but infrequently (let the topsoil dry well), keep fertilizer modest and slightly higher in phosphorus (too much nitrogen = leaves, not flowers), and prune lightly right after each flush to shape and trigger new color. Whether you plant it in the ground (it can easily reach 2\u20135 m when trained) or keep it in a 14\u201320" container for patios and terraces, Bougainvillea loves the long, hot summers of Karachi, Lahore, and Multan, and it also performs beautifully in Islamabad and Peshawar with a little winter protection\u2014simply shelter containers under an eave during cold snaps and avoid soggy soil. Thorny stems add a natural privacy and security edge, while drought tolerance makes it a smart, water-wise choice for sunny facades and rooftop gardens. Looking to wow your guests or pull attention to an entrance? Train it as an arch over your driveway; want balcony drama without the maintenance? Choose a compact variety and let it trail over the railing. For property managers, caf\xe9s, and homeowners alike, Bougainvillea is the ultimate high-impact, low-maintenance upgrade\u2014bold color, fast coverage, and a premium look that sells your space from the street.',"assets/plants/boug1.jpg",B.LJ)
