B.Sw=new A.cG("jasmine","Jasmine (Arabian)","PKR 1,600","Intensely fragrant white flowers; evening scent is magical.",'Turn every evening into a calm, perfume-filled oasis with Arabian Jasmine (Jasminum sambac)\u2014the classic, intensely fragrant climber behind Pakistan\u2019s beloved gajras and entrance garlands, now ready to elevate your home, caf\xe9, or boutique with effortless elegance. This compact, glossy-leafed vine loves warmth and bright light: give it 5\u20136 hours of sun (light afternoon shade in peak Lahore/Karachi heat is fine), plant in well-drained, compost-rich soil, and water deeply when the top inch dries\u2014never soggy, never bone-dry. In pots (12\u201316" with big drainage holes) or ground, feed every 3\u20134 weeks during the growing season with a bloom-boosting fertilizer to keep buds coming; prune lightly after a flush to shape and encourage branching, and let it twine up a trellis, balcony rail, or arch for a romantic, boutique-hotel look. In Islamabad/Rawalpindi, protect from cold snaps below ~8\u201310 \xb0C and reduce watering in winter; in coastal or southern climates, it flowers almost year-round. If aphids or whiteflies appear, a simple rinse plus neem-oil spray keeps foliage pristine without harsh chemicals. Use it as a scented entry statement, a privacy screen that greets guests at dusk, or a container feature near outdoor seating where its evening fragrance truly shines. Few plants deliver this level of luxury per rupee\u2014Arabian Jasmine is your fast track to a refined, welcoming space that smells unforgettable; add it to your garden today and let the compliments roll in.',"assets/plants/jas1.jpg",B.M4)
