B.Su=new A.cG("marigold","Marigold","PKR 250","Bright, cheerful bedding plant; easy and reliable.","Brighten your garden instantly and affordably with Marigolds (Tagetes)\u2014Pakistan\u2019s most reliable, high-impact seasonal color for borders, pots, pathways, and festive d\xe9cor. Available in rich golds, yellows, oranges, and bicolors, French types (Tagetes patula) stay compact and bushy for edging, while African types (Tagetes erecta) deliver big, showy blooms for statement beds and event garlands. They thrive in full sun (aim for 6\u20138 hours; offer light afternoon shade in peak Sindh heat), prefer well-drained soil, and reward you with nonstop flowers if you water deeply when the top inch dries and deadhead spent blooms weekly. For bushier plants with more buds, pinch young tips at 4\u20136 leaves; feed every 2\u20133 weeks with a balanced, low-nitrogen fertilizer so energy goes to flowers, not just foliage. Sow seeds in late summer to early autumn for the classic winter display in Punjab/KPK/Islamabad, or start in early spring for extended color in milder/coastal areas; transplant once seedlings have 3\u20134 true leaves, spacing 20\u201330 cm for French and 30\u201345 cm for African varieties. Naturally helpful in kitchen gardens, marigolds are known to discourage certain pests and nematodes\u2014plant them near tomatoes, chilies, and okra as cheerful \u201cbodyguards.\u201d Keep foliage clean, and if aphids or spider mites appear, a firm water spray plus neem oil usually restores perfection fast. Tough, fast-blooming, and unbelievably cost-effective per square foot, marigolds deliver that \u201cfestival look\u201d with near-zero fuss\u2014add a tray today, and watch your space go from ordinary to celebratory in a single weekend.","assets/plants/mar1.jpg",B.Mc)
