B.Sr=new A.cG("petunia","Petunia","PKR 300","Cascade of color for beds, baskets, and planters.","Create instant, high-impact color with Petunias\u2014the undisputed stars of borders, planters, window boxes, and hanging baskets\u2014delivering cascades of blooms in dazzling pinks, purples, whites, reds, and striking bicolors all season long. In Pakistan\u2019s plains, petunias shine as cool-season performers: plant from September\u2013November for a luxurious winter-spring display (great in Karachi, Lahore, Islamabad, Peshawar), and refresh in early spring if late heat arrives; in cooler hill stations, they\u2019ll flower even longer. Give them 6+ hours of sun, excellent drainage, and a light, airy potting mix (add perlite or coco peat), then water deeply when the top 2\u20133 cm dry\u2014avoid soggy roots and overhead splashing to prevent botrytis. Feed every 7\u201310 days with a balanced or bloom-boost fertilizer (or use a slow-release base plus a weekly liquid top-up), pinch young tips at 6\u20138 leaves for bushy plants, and shear back by one-third mid-season to trigger a fresh flush of buds. Choose Grandiflora for big, dramatic flowers in sheltered spots, Multiflora for wind/heat tolerance and masses of smaller blooms, and Trailing/\u201cWave\u201d/Surfinia types for that premium waterfall effect in baskets and rail planters. Space 25\u201335 cm apart, deadhead where needed (many modern types are self-cleaning), and keep an eye out for aphids/whitefly\u2014neem oil or a strong water spray usually sets things right. The result? A low-maintenance, high-value carpet of color that transforms entrances and patios into boutique-garden showpieces. Order a mixed tray today\u2014we\u2019ll plant, feed, and style them for you so your space looks professionally finished within hours.","assets/plants/pet1.jpg",B.Mi)
