B.SA=new A.cG("aloe-vera","Aloe Vera","PKR 950","Succulent with useful gel; low-water hero.","Bring home the desert superstar with Aloe Vera\u2014a sculptural, low-maintenance succulent that earns its keep with striking form and everyday usefulness. Thick, blue-green leaves store water so the plant thrives on neglect: give it bright light (full sun to bright, indirect), a free-draining cactus mix (add coarse sand/perlite), and water only when the soil is bone dry 5\u20138 cm down\u2014typically every 10\u201321 days depending on season; overwatering is the only real way to lose it. Ideal temperatures are 20\u201335 \xb0C; protect from cold snaps below ~8\u201310 \xb0C and harsh winter drafts. In Pakistan\u2019s plains, keep it outdoors in morning sun and dappled afternoon light; in peak summer heat, shift to bright shade to prevent leaf scorch. Indoors, park it by an east or west window and rotate monthly for a balanced rosette. Feed very lightly in spring (\xbc-strength succulent fertilizer) and skip winter feedings. Aloe offsets (\u201cpups\u201d) appear around the base\u2014separate and pot them for instant new plants or a fuller bowl display. Common issues like soft, collapsing leaves signal excess water; blotchy pale growth points to too little light\u2014both easy fixes. Beyond looks, the leaf gel is widely used to soothe minor skin discomforts\u2014another reason it\u2019s a household essential.* We supply chunky, well-rooted plants in 6\u20138\u2033 pots and premium specimen rosettes ready for reception corners, balconies, and kitchen windows. Want it styled? Choose our terracotta or matte ceramic potting upgrade and we\u2019ll deliver, plant, top-dress with decorative gravel, and position it for perfect light\u2014so you get that clean, modern \u201cdesigner\u201d finish from day one. Not a medical product; for serious concerns, consult a professional.","assets/plants/aloe1.jpg",B.N9)
