B.Ss=new A.cG("money-plant","Money Plant (Pothos)","PKR 700","Fast-growing indoor vine; forgiving and stylish.","Meet the Money Plant (Pothos/Devil\u2019s Ivy)\u2014the ultimate \u201cset-and-forget\u201d indoor vine that brings instant freshness, lush texture, and effortless style to homes, offices, caf\xe9s, and balconies. Famous for its heart-shaped, variegated leaves and fast growth, Pothos tolerates a wide range of conditions in Pakistan: it thrives in bright, indirect light but also copes with medium to low light (avoid harsh, direct afternoon sun), and it\u2019s wonderfully forgiving if you occasionally forget to water. Give it a drink only when the top 2\u20133 cm of soil feel dry; overwatering (yellowing leaves, soggy soil) is the only real mistake to avoid. Expect vigorous trailing stems perfect for shelves and hanging planters\u2014or train it upright on a moss pole for a fuller, leafy column; pinch tips to keep it dense and bushy, and watch new shoots explode. Variegation will be boldest in brighter light; if leaves turn more solid green, simply move it closer to a window. Normal indoor temperatures (18\u201332 \xb0C) and average humidity are ideal, pests are rare, and propagation is a joy\u2014snip a cutting with a node, root it in water, and you\u2019ve got an instant gift or a thicker mother plant. We supply premium, well-rooted Pothos in multiple formats\u20146\u20138\u2033 trailing pots, lush hanging baskets, and 10\u201312\u2033 totem styles\u2014plus a choice of matte ceramic or terracotta planters; opt for our \u201cStyled & Delivered\u201d service and we\u2019ll pot, top-dress with decorative gravel, and place it for perfect light with a simple care card. Want a fast, low-maintenance green upgrade that looks expensive and grows with you? Money Plant is your best value\u2014reliable, beautiful, and ready to transform your space from day one.","assets/plants/pothos1.jpg",B.Mn)
