B.Sq=new A.cG("bamboo-palm","Bamboo Palm","PKR 5,800","Fine-textured palm for airy, elegant screening.","Meet the Bamboo Palm (Chamaedorea seifrizii)\u2014an elegant, fine-textured clumping palm that instantly softens corners, divides spaces, and brings cool, tropical calm to homes, offices, and lobbies across Pakistan. With its slender \u201cbamboo-like\u201d canes and airy fronds, it thrives in bright, indirect to medium light (tolerates lower light better than most palms), and prefers evenly moist\u2014but never soggy\u2014soil; water when the top 2\u20133 cm are dry, and avoid harsh afternoon sun that can scorch leaf tips. Comfortable in normal indoor temperatures (18\u201332 \xb0C) and average humidity, Bamboo Palm is slow to moderate in growth, reaching 1.2\u20132 m indoors (taller in shady outdoor courtyards), is generally considered non-toxic to pets, and is praised for freshening air while adding a refined, resort-style vibe year-round. For best results, use a well-draining peat/bark mix, feed lightly at half-strength during spring\u2013summer, wipe fronds to keep them glossy, and repot every 2\u20133 years as clumps expand; if tips brown, ease up on salts and switch to filtered water. We supply premium, multi-stemmed specimens in 10\u201314\u2033 growers\u2019 pots, statement 16\u201318\u2033 floor sizes, and styled options in matte ceramic or classic terracotta; choose our \u201cStyled & Delivered\u201d package and we\u2019ll pot, top-dress, place for ideal light, and leave a simple care card\u2014plus optional maintenance visits to keep it picture-perfect. Want a lush, low-maintenance focal point that looks expensive without demanding attention? Bamboo Palm is your quietly luxurious upgrade\u2014calm, clean, and ready to elevate your space from day one.","assets/plants/bamboo1.jpg",B.O7)
