B.Si=new A.cG("rubber-plant","Rubber Plant (Ficus elastica)","PKR 4,200","Bold, glossy leaves; modern indoor statement.","Meet the Rubber Plant (Ficus elastica)\u2014a bold, sculptural statement tree with glossy, oversized leaves that instantly make any room feel more modern, curated, and alive. Tough and forgiving, it thrives in bright, indirect light (morning sun is great; harsh afternoon rays can scorch), but it also tolerates medium light better than most \u201cdesigner\u201d plants; water when the top 3\u20135 cm of soil are dry and keep the mix well-draining to avoid soggy roots. Expect slow-to-moderate growth to 1.5\u20132.5 m indoors (prune the tip to maintain a compact, bushier silhouette), wipe leaves monthly to keep that luxurious shine, and turn the pot every few weeks for even, photo-worthy symmetry. Perfectly at home in Pakistan\u2019s indoor climates (18\u201332 \xb0C), the Rubber Plant adapts to AC and low humidity, and rewards minimal care with year-round, high-impact greenery\u2014choose classic deep green \u2018Robusta\u2019 for a rich, architectural look or variegated \u2018Tineke\u2019/\u2018Ruby\u2019 for designer cream-and-blush tones that pop against neutral walls. We supply premium, straight-cane or multi-branched forms in 8\u201314\u2033 growers\u2019 pots and statement 16\u201318\u2033 floor sizes, plus styled options in matte ceramic or terracotta; add our \u201cStyled & Delivered\u201d package for professional potting, decorative top-dress, perfect placement, and a simple care card, or opt into ongoing maintenance so it always looks showroom-fresh. If you want an effortlessly upscale focal point that photographs beautifully, purifies the vibe of your space, and keeps its good looks with minimal fuss, the Rubber Plant is your best-selling upgrade\u2014quiet luxury, delivered.","assets/plants/rubber1.jpg",B.O5)
