B.So=new A.cG("dracaena","Dracaena (Song of India)","PKR 3,100","Striped, architectural foliage; easy-care indoor.","Meet Dracaena (Song of India)\u2014Dracaena reflexa with luminous lime-and-cream variegation that instantly brightens corners and adds boutique-hotel polish to homes and offices alike; its naturally tiered, architectural canes create a sculptural silhouette that looks \u201cdesigned\u201d even when you\u2019ve done almost nothing. Happy in Pakistan\u2019s indoor conditions (18\u201332 \xb0C), it thrives in bright, indirect light but stays handsome in medium light too; outdoors, give it dappled shade on verandas/patios and protect from harsh afternoon sun and cold snaps. Watering is delightfully simple: let the top 2\u20134 cm of soil dry, then water thoroughly\u2014this plant prefers a free-draining mix and absolutely hates sitting in soggy pots (hello, root rot), so choose a container with drainage and go easy in winter. Growth is slow to moderate to 1\u20132 m indoors; tip-prune to keep that layered, bushy form or to encourage fresh, variegated shoots, and wipe leaves monthly to keep the stripes glowing. Want more plants for free? It propagates from stem cuttings in warm weather, rooting readily in water or a light mix. Stylistically, Song of India is a chameleon\u2014pair with matte white, charcoal, or natural rattan planters; use single-cane for a sleek, minimal look or multi-cane clusters for lush impact beside sofas, reception desks, and entryways. We supply premium, straight or multi-brached specimens in 8\u201314\u2033 growers\u2019 pots and designer ceramic or terracotta upgrades, plus our \u201cStyled & Delivered\u201d service (professional potting, decorative top-dress, perfect placement, and a simple care card) with optional maintenance so it stays showroom-fresh. If you\u2019re after a low-effort, high-wow statement that cleans up the look of any room and photographs beautifully, Dracaena Song of India is the bright, modern upgrade your space has been waiting for.","assets/plants/drac1.jpg",B.MJ)
