B.Sg=new A.cG("gardenia","Gardenia","PKR 2,800","Luxurious scent and glossy evergreen leaves.","Discover Gardenia\u2014the timeless white-rose of the tropics\u2014celebrated for its intoxicating perfume and glossy, deep-green leaves that make any doorway, patio, or living room feel instantly luxurious; few plants deliver this level of fragrance and elegance with such compact poise. For best performance in Pakistan, give bright light with gentle morning sun and dappled afternoon shade (east or southeast exposure is ideal), keep temperatures between 18\u201328 \xb0C, and maintain consistent moisture without waterlogging in a fast-draining, slightly acidic mix (think peat/coir + perlite + pine bark); feed lightly during spring\u2013summer with an acid-loving fertilizer and use iron chelate if leaves yellow between veins. Bud drop comes from stress\u2014avoid cold drafts, heat blasts, or letting the root ball swing from bone-dry to soaked; a humidity tray or weekly foliage mist (morning only) keeps blooms coming. Expect flushes from late spring into summer, with varieties like \u2018August Beauty\u2019 or \u2018Veitchii\u2019 rewarding you with repeat flowers perfect for bridal-scent arrangements. As a premium accent, Gardenia shines in ceramic planters by entrances, on caf\xe9 tables, or in reception areas, pairing beautifully with boxwood lines and soft uplighting. We offer nursery-grade, bud-set specimens, designer pot upgrades, and our optional \u201cStyled & Delivered\u201d service\u2014professional potting, decorative top-dress, placement, and a simple care card\u2014so you enjoy that head-turning fragrance and five-star finish from day one.","assets/plants/gard1.jpg",B.MD)
