B.Sz=new A.cG("camellia","Camellia","PKR 4,900","Winter/early-spring blooms; glossy evergreen.","Meet Camellia\u2014the queen of cool-season color\u2014delivering lush, rose-like blooms precisely when most gardens are quiet, from late autumn through early spring; whether you choose classic Japonica for large, formal doubles or tough, early-blooming Sasanqua for lighter, airy flowers, you\u2019ll get an elegant, evergreen screen with glossy leaves and a premium, estate look at your door or entry court. Camellias thrive with bright, indirect light or gentle morning sun and afternoon shade (east/north exposures are ideal), in a free-draining, slightly acidic mix (pH 5.5\u20136.5); think peat/coir + pine bark + perlite with a 5\u20137 cm mulch of pine needles or bark to keep roots cool. Water deeply but infrequently\u2014never soggy\u2014and feed lightly with an acid-loving fertilizer after bloom; prune immediately post-flowering to shape (next season\u2019s buds set early). In hotter Pakistani plains, container culture under verandas or filtered shade keeps Camellias happy; in cooler hill stations they shine even in brighter spots. Expect reliable buds when temperature swings are moderate and roots stay evenly moist; protect open blooms from harsh, hot winds and severe frost snaps. We supply nursery-grade Camellias in curated colours (white, blush, rose, crimson, and variegated), plus optional \u201cStyled & Delivered\u201d setup: premium potting in our acid mix, decorative top-dress, placement plan, and a simple care card\u2014so you enjoy a winter showpiece, photo-ready hedges, and long-lived elegance with zero guesswork.","assets/plants/cam1.jpg",B.LT)
