B.Sh=new A.cG("hydrangea","Hydrangea (Macrophylla)","PKR 3,700","Huge mophead flowers; show-stopping borders.","Turn shady corners into showstoppers with Hydrangea macrophylla\u2014the famous mophead and lacecap hydrangea that delivers cloud-like blooms from late spring through summer and looks luxurious in beds, borders, and big pots; give it bright morning sun with afternoon shade (or dappled light all day in hotter areas), rich moisture-retentive but free-draining soil, and a thick bark mulch to keep roots cool and flowers lasting. Color is customizable: for blue blooms target slightly acidic pH ~5.0\u20135.5 and add aluminum sulfate; for pink aim for pH ~6.0\u20136.5 with a touch of garden lime\u2014test, adjust slowly, and feed lightly with a balanced, slow-release fertilizer in early spring and again mid-summer. Keep soil evenly moist (never waterlogged), deadhead spent clusters, and remember most macrophyllas bloom on old wood\u2014so skip hard pruning; after flowering, remove only dead or crossing stems and let next year\u2019s buds set. In the Pakistani plains, containers under verandas or east-facing beds keep foliage fresh through hot spells; in cooler hill stations they\u2019ll tolerate more light. We offer curated mophead and lacecap selections in blues, pinks, whites, and bicolors, plus our \u201cStyled & Delivered\u201d upgrade: premium potting mix, pH/color setup, decorative top-dress, placement plan, and a simple care card\u2014so you enjoy florist-grade hydrangeas at home, abundant blooms for the vase, and a garden that photographs like a resort.","assets/plants/hyd1.jpg",B.O1)
