B.Sm=new A.cG("ixora","Ixora","PKR 1,850","Clusters of bright florets; thrives in heat.","Turn up the tropical color with Ixora\u2014compact, glossy-leaved shrubs that produce dense clusters of blooms in vivid reds, oranges, yellows, and pinks almost year-round; they love warmth and bright light (aim for 5\u20137 hours of sun, with light afternoon shade in the hottest months), thrive in slightly acidic, free-draining soil (pH ~5.0\u20136.0\u2014mix in peat/pine bark and perlite), and want consistent moisture without waterlogging; feed monthly in the growing season with an acid-loving fertilizer plus iron/micronutrients to prevent leaf yellowing (chlorosis), and lightly prune after flushes of bloom to keep them bushy and flower-heavy; perfect as low hedges along paths and driveways, anchor plants in mixed borders, or statement pots for terraces in Karachi and other warm cities (treat as a patio container in cooler zones and protect from cold snaps); pair with hibiscus, areca palms, and variegated dracaena for a resort-style palette, add 5\u20137 cm of organic mulch to cool roots and hold moisture, and watch for mealybugs/scale\u2014both easily managed with neem or horticultural soap; choose from our curated dwarf and medium varieties for tight spaces or bold hedging, and let our Styled & Delivered Ixora Package handle the soil acidification, planting, drip setup, and a simple care card; order today and we\u2019ll position your Ixora for uninterrupted color, so your entrance pops, your borders glow, and your landscape looks five-star with nearly zero fuss.","assets/plants/ixo1.jpg",B.LV)
