B.Sj=new A.cG("neem","Neem Tree (Azadirachta indica)","PKR 2,900","Hardy shade tree with traditional value.","Bring home a living guardian with the Neem Tree (Azadirachta indica)\u2014a tough, evergreen shade-maker that thrives in Pakistan\u2019s heat and coastal breezes while naturally discouraging many garden pests; native to the subcontinent and celebrated for its resilient wood and aromatic foliage, neem forms a graceful, airy canopy that cools courtyards, parking areas, and farmhouses with minimal care; give it full sun (6\u20138+ hours), well-drained soil (sandy loam or any non-waterlogged ground), and deep, infrequent watering in the first year to build roots\u2014after establishment it\u2019s impressively drought-tolerant; plant 5\u20137 m from walls and lines to respect its mature spread, stake young trees against wind, and prune lightly once a year to raise the canopy and keep a clean structure; tiny white flowers appear in warm months (pollinator friendly), fruit feeds birds, and the leaves/seed contain azadirachtin\u2014a natural deterrent that helps keep the landscape healthier without harsh chemicals; salt- and heat-hardy from Karachi to Multan and Bahawalpur, neem shrugs off poor soils and blazing summers, asking only for sun and drainage; available in landscape-ready 5\u20137 ft specimens, our Planted & Guaranteed Neem Package includes site prep, premium compost, slow-release nutrients, drip emitter setup, first-year care plan, and a replacement warranty\u2014order today and enjoy a durable, low-maintenance shade tree that pays you back with comfort, cleaner air, and an inherently pest-smart garden.","assets/plants/neem1.jpg",B.M_)
