B.Sn=new A.cG("guava","Guava Tree","PKR 3,600","Delicious fruit; compact habit for small yards.","Turn any sunny corner into a mini orchard with a Guava Tree\u2014a fast-growing, sweetly aromatic fruiter that loves Pakistan\u2019s climate and rewards you with vitamin-C\u2013rich harvests for years; compact enough for modest yards yet productive in the ground or a large container (45\u201360 cm pot for dwarf types), guava is self-fertile (one tree can fruit) but sets even heavier with a second nearby; give it 6\u20138+ hours of sun, a well-drained loam, and deep, regular watering its first season to establish\u2014then reduce to a consistent soak during warm months; prune after harvest to keep an open, airy canopy (great light and airflow = bigger, cleaner fruit), remove crossing shoots, and tip-pinch young growth to encourage branching; feed lightly in spring and midsummer with a balanced fruiting fertilizer plus micronutrients; space 3\u20134 m from walls/lines for semi-dwarfs, and protect young trees from hard frost up north; creamy white blossoms invite pollinators, and the crisp-to-buttery flesh is perfect fresh, juiced, or in chutneys\u2014truly a zero-waste kitchen star; order our Fruit-Ready Guava Package\u2014site prep, compost & micronutrients, expert planting, form-pruning, drip emitter setup, a first-year care plan, and a healthy-start guarantee\u2014so you can enjoy fragrant shade and homegrown guavas with confidence.","assets/plants/guava1.jpg",B.KU)
