B.Se=new A.cG("lemon","Lemon Tree","PKR 4,300","Citrusy scent, year-round interest, patio-friendly.","Turn everyday moments into something bright and refreshing with a Lemon Tree\u2014an evergreen citrus that perfumes the air with blossoms and rewards you year-round with zesty, vitamin-C packed fruit; choose a reliable cultivar like Eureka or Lisbon for classic tang or Meyer for sweeter, thin-skinned lemons ideal for balconies, then plant in full sun (6\u20138+ hours) in well-drained, slightly acidic soil (raise the bed or use a large 50\u201375 L container with a gritty citrus mix if drainage is poor), water deeply but infrequently\u2014let the top 3\u20135 cm dry before the next soak\u2014and feed little and often with a balanced citrus fertilizer plus micros (Fe/Zn/Mg) for glossy leaves and consistent flowering; keep growth tidy with light tip-pruning after harvest, remove crossing shoots to improve airflow, mulch 5\u20138 cm to stabilize moisture (keep mulch off the trunk), and protect young trees from cold snaps or hot, desiccating winds with a breathable cover and regular watering; expect grafted trees to flower within the first season and fruit in 1\u20132 years, with best yields by year 3 (standard spacing 4\u20135 m in-ground; dwarfs 2.5\u20133 m), and manage common issues\u2014leaf miner, scale, sooty mold\u2014through good hygiene, sticky traps, horticultural oil, and strong airflow; whether you\u2019re garnishing tea, curing seafood, baking lemon tarts, or making fresh lemonade, our Lemon Starter Package can handle the hard parts\u2014site prep, soil amendment, first-year feeding schedule, and drip emitter setup\u2014so you enjoy glossy foliage, fragrant blooms, and a steady supply of home-grown lemons with minimal fuss.","assets/plants/lemon1.jpg",B.Mk)
