B.Sx=new A.cG("mango","Mango Sapling","PKR 2,700","Beloved fruit tree; thrives in heat and sun.","Bring home the king of fruits with a Mango Sapling\u2014a heat-loving, sun-hungry tree that thrives in Pakistan and rewards you with fragrant blossoms and luscious, vitamin-rich fruit for decades; plant a grafted variety (think Chaunsa, Sindhri, Anwar Ratol, Langra for classic flavor or Amrapali/Mallika for compact spaces) in 8+ hours of full sun, a well-drained loam (use a raised mound in heavier soils), and give deep, infrequent watering\u2014soak thoroughly, then let the top few centimeters dry to prevent root issues; train the canopy low (first scaffold at ~60\u201380 cm), tip-prune after harvest to encourage branching and keep height manageable, and feed lightly at bud-break and mid-summer with a balanced, fruit-forward fertilizer plus key micros (Fe/Zn/Mg) for glossy leaves and strong flowering; in cooler zones, guard young trees from frost with mulch (7\u201310 cm), a breathable cover on cold nights, and wind protection; expect grafted trees to flower within 1\u20132 seasons and fruit in 2\u20133, with yields improving each year (self-fertile but better set with a second cultivar nearby); manage common pressures\u2014fruit fly and sooty mold\u2014through orchard hygiene, airflow, and gentle, labeled controls as needed; whether you plant in-ground with 4\u20136 m spacing or a 65\u201390 L container on a warm terrace, our Mango Starter Package makes it effortless: site prep, compost and micronutrients, expert planting and formative pruning, drip emitter setup, and a first-year care plan\u2014so you can enjoy shade, perfume, and your own legendary mangoes sooner.","assets/plants/mango1.jpg",B.ND)
